const RatingWidget = () => {
  const NUM_STARS = 5;
  const STAR_ICON = '★';

  return (<>
    {
      Array.from({ length: NUM_STARS })
        .map((_, i) =>
          <button key={ i }>
            { STAR_ICON }
          </button>
        )
    }
  </>);
};

export default RatingWidget;
